from typing import List

class Solution:
    def reconstructQueue(self, people: List[List[int]]) -> List[List[int]]:
        N = len(people)
        arr = sorted(people, key=lambda x: (-x[0], x[1]))
        #print(arr)
        for i in range(1, N):
            #print(f'\ti, arr = {i}, {arr}')
            for j in range(i, 0, -1):
                prev = arr[j-1]
                curr = arr[j]
                #print(f'\t\tprev, curr = {prev}, {curr}')
                if prev[0] > curr[0] and j > curr[1]:
                    # Swap prev and curr
                    #print(f'\t\t\tAbout to swap...')
                    arr[j-1], arr[j] = arr[j], arr[j-1]
                    #print(f'\t\t\tAfter swap; arr = {arr}')
                else:
                    break
        return arr

